require.config({"config": {
        "text":{"Magento_Ui/templates/tab.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"admin__page-nav\">\n    <div class=\"admin__page-nav-title\" css=\"_collapsible: collapsible, _opened: opened && collapsible\" click=\"toggleOpened\" keyboard=\"13: toggleOpened\">\n        <strong tabindex=\"1\" text=\"label\" keyboard=\"13: toggleOpened\"></strong>\n    </div>\n    <ul class=\"admin__page-nav-items items\" each=\"elems\" visible=\"opened\">\n        <li class=\"admin__page-nav-item\" tabindex=\"2\" css=\"_active: active, _loading: loading\" click=\"activate\" keyboard=\"13: activate\">\n            <a class=\"admin__page-nav-link\" href=\"#\" css=\"_changed: changed\" attr=\"id: 'tab_' + index\">\n                <span text=\"label\"></span>\n                <span class=\"admin__page-nav-item-messages\">\n                    <span class=\"admin__page-nav-item-message _changed\">\n                        <span class=\"admin__page-nav-item-message-icon\"></span>\n                        <span class=\"admin__page-nav-item-message-tooltip\"\n                               translate=\"'Changes have been made to this section that have not been saved.'\"></span>\n                    </span>\n                    <span class=\"admin__page-nav-item-message-loader\">\n                        <span class=\"spinner\">\n                           <span repeat=\"8\"></span>\n                        </span>\n                   </span>\n                </span>\n            </a>\n        </li>\n    </ul>\n</div>\n"}
}});
